import Home from "./pages/home";
import Result from "./pages/result";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/result" component={Result} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
